100.body:
Jelikož před spuštěním programu nevíme, na jaké adrese budou uloženy hodnoty, které nás budou zajímat, tak obvykle nedává smysl inicializovat ukazatel na konkrétní adresu (např. int* p = 5;). Pro inicializaci ukazatele tak existuje několik standardních možností: Inicializace na nulu : Pokud chceme vytvořit "prázdný" ukazatel, který zatím neukazuje na žádnou validní adresu, tak se dle konvence inicializuje na hodnotu 0. Takovému ukazateli se pak říká nulový ukazatel ( null pointer ). Jelikož datový typ výrazu 0 je int, tak před přiřazením této hodnoty do ukazatele jej musíme přetypovat na datový typ cílového ukazatele: float* p = (float*) 0; Jelikož tento typ inicializace je velmi častý, standardní knihovna C obsahuje makro NULL, které konverzi nuly na ukazatel provede za vás. Můžete jej najít například v souboru stdlib.h: #include <stdlib.h>
float* p = NULL; Využití alokační funkce : Pokud budete alokovat paměť manuálně , tak použijete funkce, které vám hodnotu ukazatele vrátí jako svou návratovou hodnotu. Využití operátoru adresy : Pokud chcete ukazatel nastavit na adresu již existující hodnoty v paměti, můžete použít operátor adresy ( address-of operator ). Ten má syntaxi &<proměnná>. Tento operátor se vyhodnotí jako adresa předané proměnné [2] : #include <stdio.h> int main() { int x = 1; int* p = &x; printf("%d\n", x); // hodnota proměnné x printf("%p\n", p); // adresa v paměti, kde je uložena proměnná x return 0;
} Výraz předaný operátoru & se musí vyhodnotit na něco, co má adresu v paměti (většinou to bude proměnná ). Nedává smysl použít něco jako &5, protože 5 je číselná hodnota, která nemá žádnou adresu v paměti. Při použití tohoto operátoru je také třeba dávat si pozor na to, aby hodnota v paměti, jejíž adresu použitím & získáme, stále existovala, když se budeme později snažit k této adrese pomocí ukazatele přistoupit. V opačném případu by mohlo dojít k paměťové chybě 💣. Všimněte si, že pro výpis ukazatelů ve funkci printf se používá %p místo %d.

101.body:
Když už máme v ukazateli uloženou nějakou (validní) adresu v paměti, tak k této paměti můžeme přistoupit pomocí operátoru dereference . Ten má syntaxi *<výraz typu ukazatel>. Při použití tohoto operátoru na ukazateli program přečte adresu v ukazateli, podívá se do paměti a načte hodnotu uloženou na této adrese. Podle toho, na jaký datový typ ukazatel ukazuje, se načte odpovídající počet bytů z paměti: #include <stdio.h> int main() { int cislo = 1; int* ukazatel = &cislo; printf("%p
", ukazatel); printf("%d
", *ukazatel); printf("%d
", cislo); return 0;
} V tomto programu se do proměnné ukazatel uloží adresa proměnné cislo, a poté dojde k načtení hodnoty (*ukazatel) této proměnné z paměti přes adresu uloženou v ukazateli. Pokud chceme do adresy uložené v ukazateli naopak nějakou hodnotu zapsat, tak můžeme operátor dereference použít také na levé straně operátoru zápisu . Uhodnete, co vypíše tento program? #include <stdio.h> int main() { int cislo = 1; int* ukazatel = &cislo; *ukazatel = 5; printf("%d
", cislo); return 0;
} Pokud provádíte operace s přímo s proměnnou ukazatele, budete vždy pracovat "pouze" s adresou, která je v něm uložena. Pokud chcete načíst nebo změnit hodnotu, která v paměti leží na adrese uložené v ukazateli, musíte použít operátor dereference.

102.body:
Abychom se mohli v paměti "posouvat" o určitý kus dopředu či dozadu (relativně k nějaké adrese), můžeme k ukazatelům přičítat či odčítat čísla. Toto se označuje jako aritmetika s ukazateli ( pointer arithmetic ). Tato aritmetika má důležité pravidlo – pokud k ukazateli na konkrétní datový typ přičteme hodnotu n, tak se adresa v ukazateli zvýší o n-násobek velikosti datového typu, na který ukazatel ukazuje. Při aritmetice s ukazateli se tak neposouváme po jednotlivých bytech, ale po celých hodnotách daného datového typu [3] . Z toho vyplývá, že aritmetiku nemůžeme provádět nad ukazateli void*, protože ty neukazují na žádný konkrétní datový typ. Například, pokud bychom měli ukazatel int* p s hodnotou 16 (tj. "ukazuje" na adresu 16) a velikost intu by byla 4, tak výraz p + 1 bude ukazatel s hodnotou 20, výraz p + 2 bude ukazatel s adresou 24 atd. Je důležité rozlišovat , jestli při použití sčítání/odčítání pracujeme s hodnotou ukazatele anebo s hodnotou na adrese, která je v ukazateli uložena: int x = 1;
int* p = &x; *p += 1; // zvýšili jsme hodnotu na adrese v `p` (tj. proměnnou `x`) o `1`
p += 1; // zvýšili jsme adresu v `p` o `4` (tj. p nyní už neukazuje na `x`) K čemu je aritmetika s ukazateli užitečná se dozvíte v sekci o práci s více proměnnými zároveň . Kromě dereference a aritmetiky lze s ukazateli provádět také porovnávání (klasicky pomocí operátorů == nebo >). Díky toho můžeme například zjistit, jestli se dvě adresy rovnají.

103.body:
Jak se dozvíte v následující sekci , ukazatele jsou nezbytné pro manuální alokaci paměti. Hodí se také při práci s více proměnnými zároveň. Kromě toho je ale lze použít také například v následujících situacích, které všechny souvisí s předáváním adres (ukazatelů) do funkcí: Změna vnějších hodnot zevnitř funkce - hodnoty argumentů předávaných při volání funkcí se do funkce kopírují, nelze tak jednoduše zevnitř funkce měnit hodnoty proměnných, které existují mimo danou funkci. To je sice samo o sobě vhodná vlastnost, protože pokud bude funkce měnit pouze své lokální proměnné, případně parametry, tak bude jednodušší se v ní vyznat. Nicméně, někdy opravdu chceme ve funkci změnit hodnoty externích proměnných. Toho můžeme dosáhnout tak, že si do funkce místo hodnoty proměnné pošleme její adresu v ukazateli, a pomocí této adresy pak hodnotu proměnné změníme. Takto například můžeme vytvořit funkci, která vezme adresy dvou proměnných a prohodí jejich hodnoty: #include <stdio.h>
void swap(int* a, int* b) { int tmp = *a; *a = *b; *b = tmp;
}
int main() { int x = 5; int y = 10; swap(&x, &y); printf("Po prehozeni: x=%d, y=%d\n", x, y); return 0;
} Vrácení více návratových hodnot - posílání adres proměnných do funkce můžeme využít také k tomu, abychom z funkce vrátili více než jednu návratovou hodnotu (do adres uložených v parametrech totiž můžeme zapsat "návratové" hodnoty). Toho bychom však měli využívat pouze, pokud je to opravdu nezbytné. Takovéto funkce je totiž složitější volat a nejsou čisté , protože obsahují vedlejší efekt - mění externí stav programu. Sdílení hodnot bez kopírování - pokud bychom měli proměnné, které v paměti zabírají velké množství bytů (například struktury ), a předávali je jako argumenty funkci, tak může být zbytečně pomalé je pokaždé kopírovat. Pokud do funkce pouze předáme jejich adresu, tak dojde ke kopii pouze jednoho čísla s adresou, nezávisle na tom, jak velká je proměnná, která je na dané adrese uložena. Ukazatele tak můžeme použít ke sdílení hodnot v paměti mezi funkcemi bez toho, abychom je kopírovali.

106.body:
K naalokování paměti můžeme použít funkci malloc ( memory alloc ), která je dostupná v souboru stdlib.h ze standardní knihovny C . Tato funkce má následující signaturu [1] : void* malloc(size_t size); Datový typ size_t reprezentuje bezznaménkové celé číslo, do kterého by měla jít uložit velikost největší možné hodnoty libovolného typu. Často se používá pro indexaci polí . Parametr size udává, kolik bytů paměti se má naalokovat. Tuto velikost můžeme "tipnout" manuálně, nicméně to není moc dobrý nápad, protože bychom si museli pamatovat velikosti datových typů (přičemž jejich velikost se může lišit v závislosti na použitém operačním systému či překladači!). Abychom tomu předešli, tak můžeme použít výraz sizeof, kterému můžeme předat datový typ [2] a tento výraz se poté vyhodnotí jako velikost daného datového typu: #include <stdio.h>
int main() { printf("Velikost int je: %d\n", sizeof(int)); printf("Velikost int* je: %d\n", sizeof(int*)); return 0;
} Případně výraz, v tom případě si sizeof vezme jeho datový typ. Návratový typ void* reprezentuje ukazatel na libovolná data. Funkce malloc musí fungovat pro alokaci libovolného datového typu, proto musí mít návratový typ právě univerzální ukazatel void*. Při zavolání funkce malloc bychom měli tento návratový typ přetypovat na ukazatel na datový typ, který alokujeme. Při zavolání mallocu dojde k naalokování size bytů na haldě. Adresa prvního bytu této naalokované paměti se poté vrátí jako návratová hodnota mallocu. Zde je ukázka programu, který naalokuje paměť pro jeden int ve funkci, adresu naalokované paměti poté vrátí jako návratovou hodnotu a naalokovaná paměť je poté přečtena ve funkci main: #include <stdlib.h> int* allocate() { int* memory = (int*) malloc(sizeof(int)); *memory = 5; return memory; }
int main() { int* memory = allocate(); printf("%d\n", *memory); return 0;
}

114.body:
Hodnota zadaná v hranatých závorkách by měla být konstantní (tj. buď přímo číselná hodnota anebo konstantní proměnná ). Pokud budete potřebovat pole dynamické velikosti, tak byste měli použít manuální alokaci paměti . Jazyk C od verze C99 již sice povoluje dávat do hranatých závorek i "dynamické hodnoty": int velikost = ...; // velikost se načte např. ze souboru
int pole[velikost]; Nicméně tuto funkcionalitu není vhodné používat. Zásobník má omezenou velikost a není určen pro alokaci velkého množství paměti [3] . Pokud navíc velikost takovéhoto pole může ovlivnit uživatel programu (např. zadáním vstupu), může váš program jednoduše "shodit", pokud by zadal velké číslo a došlo by k pokusu o vytvoření velkého pole na zásobníku. Zkuste se tak vyvarovat používání dynamických hodnot při vytváření polí na zásobníku. Můžete si například zkusit přeložit následující program: int main() { int pole[10000000]; return 0;
} Při spuštění by měl program selhat na paměťovou chybu , i když váš počítač má pravděpodobně více než 10000000 * 4 (cca 38 MiB) paměti. Pokud chcete alokovat více než několik stovek bytů, použijte raději dynamickou alokaci na haldě.

116.body:
K přístupu k jednotlivým prvkům pole můžeme využít ukazatelů . Proměnná pole se totiž chová jako ukazatel na první prvek (prvek na nultém indexu) daného pole, pomocí operátoru dereference tak můžeme jednoduše přistoupit k prvnímu prvku pole: #include <stdio.h> int main() { int array[3] = { 1, 2, 3 }; printf("%d
", *array); return 0;
} Abychom přistoupili i k dalším prvkům v poli, tak můžeme využít aritmetiky s ukazateli . Pokud chceme získat adresu prvku na i-tém indexu, stačí k ukazateli na první prvek přičíst i [4] : #include <stdio.h> int main() { int array[3] = { 1, 2, 3 }; printf("%d
", *(array + 0)); // první prvek pole printf("%d
", *(array + 1)); // druhý prvek pole printf("%d
", *(array + 2)); // třetí prvek pole return 0;
} Všimněte si, že při použití operátoru dereference zde používáme závorky. Je to z důvodu priority operátorů . Výraz *array + 2 by se vyhodnotil jako první prvek z pole array plus 2, protože * (dereference) má větší prioritu než sčítání. Nyní už možná tušíte, proč se při práci s poli vyplatí počítat od nuly. Prvek na nultém indexu je totiž vzdálen nula prvků od začátku pole. Prvek na prvním indexu je vzdálen jeden prvek od začátku pole atd. Pokud bychom indexovali od jedničky, museli bychom při výpočtu adresy relativně k ukazateli na začátek pole vždy odečíst jedničku, což by bylo nepraktické.

117.body:
Jelikož je operace přístupu k poli ("posunutí" ukazatele a jeho dereference) velmi běžná (a zároveň relativně krkolomná), C obsahuje speciální operátor, který jej zjednodušuje. Tento operátor se nazývá array subscription operator a má syntaxi <výraz a>[<výraz b>]. Slouží jako zkratka [5] za *(<výraz a> + <výraz b>). Například array[0] je ekvivalentní výrazu *(array + 0), array[5] je ekvivalentní výrazu *(array + 5) atd: int array[3] = { 1, 2, 3 };
array[0] = 5; // nastavili jsme první prvek pole na hodnotu `5`
int c = array[2]; // nastavili jsme `c` na hodnotu posledního prvku pole Takovéto "zkratky", které v programovacím jazyku nepřináší novou funkcionalitu, pouze zkracují či zjednoduššují často používané kombinace příkazů, se označují jako syntax sugar . Jelikož je používání hranatých závorek přehlednější než používání závorek a hvězdiček, doporučujeme je používat pro přistupování k prvkům pole, pokud to půjde. Pozor na rozdíl mezi tímto operátorem a definicí pole. Obojí sice používá hranaté závorky, ale jinak spolu tyto dvě věci nesouvisejí. Podobně jako se * používá pro definici datového typu ukazatele a zároveň jako operátor dereference (navíc i jako operátor pro násobení). Vždy záleží na kontextu, kde jsou tyto znaky použity.

120.body:
Už víme, že když předáváme argumenty do funkcí, tak se jejich hodnota zkopíruje. U statických polí tomu tak ovšem není, protože pole můžou být potenciálně velmi velká a provádění kopií polí by tak potenciálně mohlo trvat dlouhou dobu. Když tak použijeme proměnnou pole jako argument při volání funkce, dojde k tzv. konverzi pole na ukazatel ( array to pointer decay ). Pole se tak vždy předá jako ukazatel na jeho první prvek: #include <stdio.h> void print_array(int* array) { printf("%d\n", array[0]);
} int main() { int array[3] = { 1, 2, 3 }; print_array(array); return 0;
} Pro parametry sice můžete použít datový typ pole: void print_array(int array[3]) { ... } nicméně i v tomto případě se bude takovýto parametr chovat stejně jako ukazatel (v tomto případě tedy int*). Navíc překladač ani nebude kontrolovat, jestli do takového parametru opravdu dáváme pole se správnou velikostí. Pro parametry reprezentující pole tak radši používejte ukazatel.

127.body:
Při práci s dvourozměrným polem bychom chtěli pracovat s dvourozměrným indexem (řádek i, sloupec j), nicméně při samotném přístupu do paměti pak musíme tento vícerozměrný index převést na 1D index. A naopak, z 1D indexu bychom chtěli mít možnost získat zpět 2D index. Pro výpočet indexů 2D pole s rows řádky a cols sloupci můžeme použít tyto jednoduché vzorce: Převod z 2D do 1D - abychom se dostali na cílovou pozici, musíme přeskočit row řádků, kde každý řádek má cols prvků, a poté ještě musíme přičíst pozici sloupce (col). int to_1d(int row, int col, int cols) { return row * cols + col;
} Převod z 1D do 2D - pro převod z 1D indexu zpět na 2D index stačí aplikovat opačný postup. Nejprve vydělíme 1D index počtem sloupců, abychom zjistili, na jakém jsme řádku, a poté použijeme zbytek po dělení, abychom zjistili, na jakém jsme sloupci. void to_2d(int index, int cols, int* row, int* col) { *row = index / cols; *col = index % col;
} Tento koncept lze zobecnit na libovolně rozměrné pole (3D, 4D, ...).

144.body:
Počítače jsou deterministické stroje, což znamená, že stejný program vždy na stejný vstup vrátí stejný výstup. Často ovšem chceme, aby naše programy obsahovaly prvky "náhody", když chceme například: Hodit si kostkou v deskové hře Udělit náhodný počet zranění v rozsahu zbraně Oživit hráče na náhodné pozici na mapě Počítače samy o sobě opravdovou náhodu vytvořit nemohou, nicméně můžou ji simulovat pomocí tzv. pseudo-náhodných generátorů čísel ( pseudo-random number generation ). Vygenerovat (pseudo-)náhodnou sekvenci čísel pomocí deterministických operací můžeme například následujícím algoritmem: Začneme s číslem S, které se nazývá počáteční náhodná hodnota ( random seed ). Aplikujeme nějakou matematickou operaci na S a vyjde nám nové číslo N. N použijeme jako vygenerované "náhodné číslo". Nastavíme S = N. Opakujeme postup od bodu 2). Ukázka kódu, který takovýto algoritmus implementuje: int S = 5;
int random() { int N = S; N = (5 * N + 3) % 6323; N = (4 * N + 2) % 8127; S = N; return N;
}
int main() { int r1 = random(); // 114 int r2 = random(); // 2294 int r3 = random(); // 4348 int r4 = random(); // 2971 int r5 = random(); // 723 return 0;
} Takovýto algoritmus bude generovat (nekonečnou) sekvenci čísel, která bude lidem připadat "náhodná" (bude těžké uhodnout, jaké číslo algoritmus vrátí příště).

146.body:
Při praktickém použití si obvykle nebudete psát generátor pseudo-náhodných sami, ale použijete již hotové řešení. To nabízí například standardní knihovna C ve formě funkcí srand (nastav hodnotu seed u) a rand (vygeneruj pseudo-náhodné číslo): #include <stdlib.h>
#include <time.h> int main() { int now = (int) time(NULL); // získej současný čas srand(now); // nastav S na současný čas int num1 = rand(); // pseudo-náhodné číslo z intervalu [0, RAND_MAX] int num2 = rand() % 100; // z intervalu [0, 99] int num3 = rand() % 100 + 5; // z intervalu [5, 104] float num4 = rand() / (float) RAND_MAX; // z intervalu [0.0, 1.0] return 0;
}

