18.body:
Ještě než si ukážeme, jak vlastně programovací jazyk C funguje, tak zkusíme přeložit velmi jednoduchý C program do spustitelného souboru a spustit jej. Vytvořte soubor s názvem main.c a nakopírujte do něj následující C kód (později si vysvětlíme, jak tento kód funguje): #include <stdio.h> int main() { printf("Hello world!\n"); return 0;
} Tento program se nazývá Hello world, jelikož tento text vypíše na obrazovku. Podobný jednoduchý program je obvykle tím prvním, co programátor v nějakém novém programovacím jazyce vytvoří. Nyní otevřete terminál (Ctrl + Alt + T v Ubuntu) ve složce s tímto souborem, spusťte program gcc a předejte mu cestu k tomuto souboru: $ gcc main.c -o program Tímto příkazem řeknete "Gécécéčku", aby přeložil zdrojový soubor main.c a uložil výsledný spustitelný soubor do souboru program. Pokud byste přepínač -o <nazev souboru> nepoužili, tak se vytvoří spustitelný soubor s názvem a.out. Na Windowsu spustitelné soubory mají obvykle příponu .exe, na Linuxu to však není běžnou praxí a spustitelné soubory typicky žádnou příponu nemají. Pokud chcete nyní program spustit, stačí v terminálu zadat (relativní) cestu k danému spustitelnému souboru. $ ./program
