V určitých případech můžeme chtít mít proměnné s konstantní hodnotou, které by se neměly v průběhu programu měnit. Takové proměnné se nazývají konstanty ( constants ). Abychom zamezili nechtěné změně hodnoty konstanty, můžeme datový typ proměnné označit klíčovým slovem const, který umístíme před [1] název datového typu. Pokud bychom se snažili o změnu proměnné s takovýmto datovým typem, překladač nám to nedovolí. int main() { const int a = 5; a += 1; // chyba return 0;
} Modifikátor const lze umístit i za datový typ. Někteří programátoři o umístění tohoto modifikátoru vedou vášnivé diskuze . Důležité hlavně je, abyste ve volbě umístění modifikátorů byli konzistentní a používali je na všech místech stejně. Použití konstant může mít několik důvodů: V programech někdy opakovaně použiváme konstantní hodnoty, které mají pevně danou hodnotu. Při čtení zdrojového kódu nemusí být jasné, co takového hodnoty znamenají (v takovém případě se hanlivě označují jako "magické konstanty"). Abychom takového hodnoty pojmenovali, můžeme je uložit do konstantní proměnné. Při čtení programu pak bude zřejmé, co reprezentují. Porovnejte variantu s nepopsanými číselnými hodnotami: float vypocti_cenu(float cena) { return cena * (1 + 0.21);
}
float vypocti_odvod(float celkova_cena, bool dph) { if (dph) { return celkova_cena * 0.21; } else { return 0; }
} s variantou využívající pojmenované konstanty: const float DPH = 0.21f; float vypocti_cenu(float cena) { return cena * (1 + DPH);
}
float vypocti_odvod(float celkova_cena, bool dph) { if (dph) { return celkova_cena * DPH; } else { return 0; }
} Druhá varianta kódu je jistě čitelnější. V určitých případech, například u konstantních řetězců , jsou data uložena v oblasti paměti, kterou nelze měnit. Pomocí const si můžeme pohlídat, že se takováto paměť opravdu nezmění.

44.body:
Často potřebujeme hodnotu proměnné pouze trochu poupravit, a ne do ní vyloženě zapsat novou hodnotu. Běžná je například operace zvýšení hodnoty proměnné o 1 (tzv. inkrementace proměnné). K tomu můžeme použít tento příkaz: count = count + 1; // zvýšení hodnoty proměnné `count` o 1 nicméně to je docela zdlouhavé. Proto C nabízí tzv. operátory složeného zápisu ( compound assignment ). Tyto operátory jsou spojené z normálního operátoru (např. +) a operátoru =: +=, -=, *=, atd. Složený zápis <proměnná> <operátor>= <výraz>; je ekvivalentní příkazu <proměnná> = <proměnná> <operátor> <výraz>; Například: int count = 0;
count += 1; // stejné jako count = count + 1;
count *= 3; // stejné jako count = count * 3; Stejně jako zápis je složený zápis příkladem výrazu s vedlejším efektem.

45.body:
Speciálním případem složeného zápisu je tzv. inkrementace (zvýšení hodnoty proměnné o jedničku) a dekrementace (snížení hodnoty proměnné o jedničku). Tyto operace jsou tak časté, že C obsahuje speciální "zkratky" pro jejich provedení. Aby to nebylo tak jednoduché, tak tyto zkratky existují ve dvou variantách: Postfixová : <proměnná>++. Tento výraz se vyhodnotí jako hodnota dané proměnné, a poté zvýší hodnotu proměnné o jedničku. Zkuste uhodnout, co vypíše následující program: #include <stdio.h> int main() { int a = 1; int b = a++; printf("%d
", a); printf("%d
", b); return 0;
} Prefixová : ++<proměnná>. Tento výraz nejprve zvýší hodnotu proměnné, a až poté se vyhodnotí jako (nová, již zvýšená) hodnota dané proměnné. Zkuste uhodnout, co vypíše následující program: #include <stdio.h> int main() { int a = 1; int b = ++a; printf("%d
", a); printf("%d
", b); return 0;
} Dekrementace se chová totožně jako inkrementace, pouze s tím rozdílem, že snižuje hodnotu proměnné o 1 a místo ++ používá --. Inkrementace a dekrementace jsou příklady výrazů s vedlejším efektem. Tyto zkratky jsou sice užitečné, ale také můžou vyústit v překvapivé chování díky způsobu, kterým jsou vyhodnocovány. Ze začátku je radši využívejte pouze v situacích, kdy budou použity jako příkaz, který změní hodnotu proměnné (i++;). Jinak řečeno, raději se moc nespoléhejte na hodnotu, ve kterou se inkrementace/dekrementace vyhodnotí.

