int kamil_body = 13; bool remize = jarda_body == kamil_body; // false
bool vyhra_jardy = jarda_body > kamil_body; // true int delka_hesla = 8;
bool heslo_moc_kratke = delka_hesla <= 5; // false Dávejte si ovšem pozor na to, že pouze operátory == a != lze použít univerzálně na všechny datové typy. Například použít < pro porovnání dvou Booleovských hodnot obvykle nedává valný smysl, operátory <, <=, > a >= jsou obvykle využívány pouze pro porovnávání čísel. Porovnávání hodnot můžete zkombinovat s logickými operátory pro vyhodnocení komplexních pravdivostních výrazů: #include <stdbool.h>
#include <stdio.h> int main() { int delka_hesla = 8; bool email_overen = false; int rok_narozeni = 1994; bool uzivatel_validni = delka_hesla >= 9 && (email_overen || rok_narozeni > 1990); // false bool uzivatel_validni2 = delka_hesla >= 9 && email_overen || rok_narozeni > 1990; // true printf("%d\n", uzivatel_validni); printf("%d\n", uzivatel_validni2); return 0;
} Zde je opět třeba dávat si pozor na prioritu operátorů (například && má větší prioritu než ||) a v případě potřeby výrazy uzávorkovat. Pokud si zkusíte přeložit tento program, tak vás dokonce překladač bude varovat před tím, že jste výraz neuzávorkovali a může tak vracet jiný výsledek, než očekáváte.

