} else if (points > 70) { // blok C, méně než 81 bodů, ale více než 70 bodů
}
// X Takovéto spojené podmínky se vyhodnocují postupně shora dolů. První podmínka if, jejíž výraz je vyhodnocen jako true, způsobí, že se provede blok této podmínky, a následně program pokračuje za celou spojenou podmínkou (bod X). Na konec spojené podmínky můžete opět vložit i else s blokem bez podmínky. Tento blok se provede pouze, pokud žádná z předchozích podmínek není splněna: if (points > 90) { // blok A, více než 90 bodů
