printf("1\n");
printf("2\n");
... což by vedlo k nepřehledným programům [1] . Pokud bychom navíc našli v programu chybu, museli bychom ji opravit na všech místech, kam jsme kód zkopírovali. Představte si, že chcete na výstup programu nebo do souboru vypsat třeba tisíc různých řádků textu. Ani s kopírováním kódu bychom si však nevystačili, pokud bychom potřebovali provádět kód opakovaně v závislosti na vstupu programu. Představte si situaci, kdy nám uživatel na vstup programu zadá číslo, kolikrát má náš program vypsat nějaký řádek textu na výstup. Uživatel se při každém spuštění programu může rozhodnout pro jiné číslo, 0, 1, 42, 1000. Program však zůstává stále stejný - při jeho psaní se musíme rozhodnout, kolik příkazů pro výpis v něm použijeme, a už poté nemůžeme jednoduše tuto volbu změnit, když program běží. Takovýto program bychom tedy zatím (pouze pomocí proměnných a podmínek) neměli jak naprogramovat. Proto programovací jazyky nabízí tzv. cykly ( loops ), pomocí kterých můžeme jednoduše říct počítači, aby určitý blok kódu opakoval, kolikrát budeme chtít. Díky tomu může program i s pouze několika málo řádky kódu říct počítači, aby provedl spoustu instrukcí. Jazyk C nabízí dva základní typy cyklů, while a for . Další motivací pro využití cyklů je to, že moderní procesory počítačů mají běžně frekvence od 1 do 4 GHz, takže za vteřinu zvládnou provést několik několik miliard taktů a během každého taktu navíc až desítky různých operací. Jistě si dovedete představit, že s pouze sekvenčním zápisem kódu bychom tento potenciál nemohli naplno využít. I když jeden řádek C kódu může být přeložen až na desítky procesorových instrukcí, tak i kdybychom zvládli napsat program se stovkami milionů řádek, pořád bychom takovýmto programem "zabavili" procesor na pouhou vteřinu. Běžící programy tak obvykle tráví většinu času prováděním nějakého cyklu.

70.body:
Nejjednodušším cyklem v C je cyklus while ("dokud"): while (<výraz typu bool>) { // blok cyklu
} Funguje následovně: Nejprve se vyhodnotí (Booleovský) výraz v závorce za while. Pokud výraz není pravdivý, tak se provede bod 3. Pokud je výraz pravdivý, tak se provede blok [1] cyklu a dále se pokračuje bodem 1. Program pokračuje za cyklem while. Blok cyklu se také často nazývá jako tělo ( body ) cyklu. Jinak řečeno, dokud bude splněná podmínka za while, tak se bude opakovaně provádět tělo cyklu. Vyzkoušejte si to na následujícím příkladu: #include <stdio.h> int main() { int count = 0; while (count < 5) { printf("Telo cyklu se provedlo\n"); count = count + 1; } return 0;
} Tento kód opět můžeme přečíst jako větu: Dokud je hodnota proměnná menší než pět, prováděj tělo cyklu. Jedno vykonání těla cyklu se nazývá iterace . Cyklus v ukázce výše tedy provede pět iterací, protože se tělo cyklu provede pětkrát. Pokud výraz za while není splněn, když se while začne vykonávat, tak se tělo cyklu nemusí provést ani jednou (tj. bude mít nula iterací). Je důležité dávat si pozor na to, aby cyklus, který použijeme, nebyl nechtěně nekonečný ( infinite loop ), jinak by náš program nikdy neskončil. Zkuste v kódu výše zakomentovat nebo odstranit řádek count = count + 1; a zkuste program spustit. Jelikož se hodnota proměnné count nebude nijak měnit, tak výraz count < 5 bude stále pravdivý a cyklus se tak bude provádět neustále dokola. Této situaci se lidově říká "zacyklení" [2] . Po spuštění nekonečného cyklu v prohlížeči radši restartujte tuto stránku :) Pokud program spouštíte v terminálu a zacyklí se, můžete ho přerušit pomocí klávesové zkratky Ctrl + C.

72.body:
V cyklech můžete využívat dva speciální příkazy, které fungují pouze v těle nějakého cyklu: Příkaz continue; způsobí, že se přestane vykonávat tělo cyklu, a program se vrátí na začátek cyklu (tedy u while na vyhodnocení výrazu). continue lze chápat jako skok na další iteraci cyklu. Zkuste uhodnout, co vypíše následující kód: #include <stdio.h> int main() { int count = 0; while (count < 10) { count = count + 1; if (count < 5) continue; printf("Hodnota count: %d\n", count); } return 0;
} Příkaz break; způsobí, že se cyklus přestane vykonávat a program začne vykonávat kód, který následuje za cyklem. Cyklus se tak zcela přeruší. Zkuste uhodnout, co vypíše následující kód: #include <stdio.h> int main() { int count = 0; while (count < 10) { if (count * 2 > 12) break; printf("Hodnota count: %d\n", count); count = count + 1; } return 0;
} Tip pro návrh cyklů while Příkaz break lze také někdy použít k usnadnění návrhu cyklů. Pokud potřebujete napsat while cyklus s nějakou složitou podmínkou ukončení, ze které se vám motá hlava, zkuste nejprve vytvořit "nekonečný" cyklus pomocí while (true) { ... }, dále vytvořte tělo cyklu a až poté přidejte dovnitř cyklu podmínku, která cyklus ukončí pomocí příkazu break: #include <stdio.h> int main() { int count = 0; int count2 = 1; while (1) { printf("Hodnota count: %d\n", count); count = count + 1; count2 += count; if (count > 100) break; if (count * 3 + count2 / count > count / 8) break; } return 0;
} Nemusíte tak hned ze začátku vymýšlet výraz pro while, na čemž byste se mohli zaseknout. Místo while (true) můžete použít také while (1), protože 1 se při převodu na bool převede na true.

74.body:
Cyklus while má také alternativu zvanou do while. Tento cyklus má následující syntaxi: do { // tělo cyklu
}
while (<výraz typu bool>); Tento kód můžeme číst jako Dělej <tělo cyklu>, dokud platí <výraz>. Jediný rozdíl mezi while a do while je, že v cyklu do while se výraz, který určuje, jestli se má provést další iterace cyklu, vyhodnocuje až na konci cyklu. Tělo cyklu tak bude pokaždé provedeno alespoň jednou (i kdyby byl výraz od začátku nepravdivý). Pokud pro to nemáte zvláštní důvod, asi není třeba tento typ cyklu používat.

75.body:
V programech velmi často potřebujeme vykonat nějaký blok kódu přesně n-krát: Projdi n řádků ze vstupního souboru a sečti jejich hodnoty. Pošli zprávu všem n účastníkům chatu. Vystřel přesně třikrát ze zbraně. I když pomocí cyklu while můžeme vyjádřit provedení n iterací, je to relativně zdlouhavé, protože je k tomu potřeba alespoň tří řádků: Inicializace cyklu: vytvoření řídící proměnné, která se bude kontrolovat v cyklu Kontrola výrazu: kontrola, jestli už proměnná nabrala požadované hodnoty Operace na konci cyklu: změna hodnoty řídící proměnné int i = 0; // inicializace
while (i < 10) { // kontrola výrazu // tělo cyklu i += 1; // změna hodnoty řídící proměnné
} Cyklus for existuje, aby tuto častou situaci zjednodušil. Kód výše by se dal pomocí cyklu for přepsat takto: for (int i = 0; i < 10; i += 1) { // tělo cyklu
} Jak lze vidět, for cyklus v sobě kombinuje inicializaci cyklu, kontrolu výrazu a provedení příkazu po každé iteraci. Obecná syntaxe tohoto cyklu vypadá takto: for (<příkaz A>; <výraz typu bool>; <příkaz B>) { // tělo cyklu
} Takovýto cyklus se vykoná následovně: Jakmile se cyklus začne vykonávat, nejprve se provede příkaz A. Zde se typicky vytvoří řídící proměnná s nějakou počáteční hodnotou. Zkontroluje se výraz. Pokud není pravdivý, cyklus končí a program pokračuje za cyklem for. Pokud je pravdivý, provede se tělo cyklu a program pokračuje bodem 3. Provede se příkaz B a program pokračuje bodem 2. Cvičení : Napište program, který pomocí cyklu for na výstup vypíše čísla od 0 do 9 (včetně).

76.body:
Zatím jsme veškerý kód psali pouze na jedno místo v programu, do "mainu". Jakmile programy začnou být větší a větší, tak začne také být neustále těžší a těžší se v nich zorientovat a udržet je celé v hlavě, abychom nad nimi mohli přemýšlet. Zároveň se nám v programu brzy začnou objevovat úseky kódu, které jsou téměř totožné, ale liší se v drobných detailech. Chtěli bychom tak mít možnost takovýto kód napsat pouze jednou a tyto měnící se detaily do něj pouze "dosadit". K rozdělení kódu programu do sady ucelených částí a jejich parametrizaci slouží funkce ( functions ). Funkce je pojmenovaný blok kódu, na který se můžeme odkázat v jiné části programu a vykonat tak kód, který se ve funkci nachází. S jednou funkcí už jsme se setkali. Jedná se o funkci main, jejíž kód je proveden při spuštění programu. My si nicméně můžeme vytvořit vlastní funkce. Zde je příklad vytvoření, tj. definice ( definition ) jednoduché funkce s názvem [1] vypis_text: void vypis_text() { printf("Ahoj\n");
} Pravidla pro pojmenovávání funkcí jsou totožná s pravidly pro pojmenovávání proměnných . Před názvem funkce je nutné uvést datový typ (zde je uveden typ void). Níže bude vysvětleno, k čemu tento typ slouží. Tento blok [2] kódu se přeloží na instrukce a bude existovat v přeloženém programu stejně jako funkce main, nicméně sám o sobě se nezačne provádět. Abychom kód této funkce provedli, musíme ji tzv. zavolat ( call ). To provedeme tak, že napíšeme název této funkce a za něj dáme závorky (()): #include <stdio.h> void vypis_text() { printf("Ahoj\n");
}
int main() { vypis_text(); // zavolání funkce vypis_text return 0;
} Stejně jako u cyklů se bloku kódu funkce často říká tělo funkce ( function body ). Zavolání funkce je výraz, při jehož vyhodnocení dojde k provedení kódu funkce, která se volá. Když se v programu nahoře ve funkci main vykoná řádek vypis_text();, tak se začne vykonávat kód funkce vypis_text. Jakmile se příkazy z této funkce vykonají, tak program bude pokračovat ve funkci main. Pomocí volání funkcí můžeme mít kus kódu v programu zapsán pouze jednou ve funkci, a poté ho můžeme spouštět z různých částí programu, podle toho, kdy se nám to zrovna bude hodit.

77.body:
Funkcím lze dávat vstupy zvané parametry ( parameters ). Parametry jsou proměnné uvnitř funkce, jejichž hodnotu nastavujeme při zavolání dané funkce. Například následující funkce vypis_cislo má parametr cislo s datovým typem int. #include <stdio.h> void vypis_cislo(int cislo) { printf("Cislo: %d\n", cislo);
}
int main() { vypis_cislo(5); return 0;
} Při zavolání funkce musíme pro každý její parametr do závorek dát hodnotu odpovídajícího datového typu. Zde je jediný parameter typu int, takže při zavolání této funkce musíme do závorek dát jednu hodnotu datového typu int: vypis_cislo(5). Před spuštěním příkazů ve funkci dojde k tomu, že hodnota každého parametru se nastaví na hodnotu předanou ve volání funkce [3] . Při zavolání vypis_cislo(5) si tak můžete představit, že se vykoná následující kód: { // nastavení hodnot parametrů int cislo = 5; // tělo funkce printf("Cislo: %d\n", cislo); } Hodnoty (výrazy) předávané při volání funkce se nazývají argumenty ( arguments ). Při volání vypis_cislo(5) se tedy do parametru cislo nastaví hodnota argumentu 5. Parametrů mohou funkce brát libovolný počet, nicméně obvykle se používá maximálně cca 5 parametrů, aby funkce a její používání (volání) nebylo příliš složité. Jednotlivé parametry jsou odděleny v definici funkce i v jejím volání čárkami: #include <stdio.h> void vypis_cisla(int a, int b) { printf("Cislo a: %d\n", a); printf("Cislo b: %d\n", b);
}
int main() { vypis_cisla(5 + 5, 11 * 2); return 0;
} Pomocí parametrů můžeme vytvořit kód, který není "zadrátovaný" na konkrétní hodnoty, ale umí pracovat s libovolnou hodnotou vstupu. Díky toho lze takovou funkci využít v různých situacích bez toho, abychom její kód museli kopírovat. Příklady použití parametrů funkcí: Funkci vypis_ctverec, která přijme jako parametr číslo n a vypíše na výstup čtverec tvořený znaky x o straně n. Funkci vykresli_pixel, která přijme jako parametry souřadnici na obrazovce a barvu a vykreslí na obrazovce na dané pozici pixel s odpovídající barvou. Cvičení : Zkuste naprogramovat funkci vypis_ctverec.

78.body:
Nejenom, že funkce můžou přijímat vstup, ale umí také vracet výstup. Datový typ uvedený před názvem funkce udává, jakého typu bude tzv. návratová hodnota ( return value ) dané funkce. V příkladech výše jsme viděli datový typ void. Tento datový typ je speciální, protože říká, že funkce nebude vracet nic . Pokud funkce má návratový typ void, tak nevrací žádnou hodnotu - pokud zavoláme takovouto funkci, tak se sice provede její kód, ale výraz zavolání nevrátí žádnou hodnotu: void funkce() {} int main() { // chyba při překladu, funkce nic nevrací int x = funkce(); return 0;
} Často bychom nicméně chtěli funkci, která přijme nějaké hodnoty (parametry), vypočte nějakou hodnotu a poté ji vrátí. Toho můžeme dosáhnout pomocí příkazu return <výraz>;. Při provedení tohoto výrazu se přestane funkce vykonávat a její volání se vyhodnotí hodnotou předaného výrazu. Zde je příklad funkce, která bere jako vstup jedno číslo a spočítá jeho třetí mocninu: #include <stdio.h> int treti_mocnina(int cislo) { return cislo * cislo * cislo;
}
int main() { printf("%d\n", treti_mocnina(5 + 1)); return 0;
} Příkazů return může být ve funkci více: int absolutni_hodnota(int cislo) { if (cislo >= 0) { return cislo; } return -cislo;
} Nicméně je důležité si uvědomit, že po provedení příkazu return už funkce dále nebude pokračovat: int zvetsi(int cislo) { return cislo + 1; printf("Provadi se funkce zvetsi\n"); // tento řádek se nikdy neprovede
} Pokud má funkce jakýkoliv jiný návratový typ než void, tak v ní musí být vždy proveden příkaz return! Pokud k tomu nedojde, tak program může začít vykazovat nedefinované chování 💣 a může se tak chovat nepředvídatelně. Například následující funkce je špatně, protože pokud hodnota parametru cislo bude nezáporná, tak se ve funkci neprovede příkaz return: int absolutni_hodnota(int cislo) { if (cislo < 0) { return -cislo; }
} Pokud má funkce návratový typ void, tak její provádění můžeme ukončit pomocí příkazu return; (zde nepředáváme žádný výraz, protože funkce nic nevrací).

80.body:
Zde je pro zopakování uveden přehled výhod používání funkcí: Znovupoužitelnost kódu: pokud chcete stejný kód použít na více místech programu, nemusíte ho "copy-pastovat". Stačí ho vložit do funkce a tu poté zavolat. Parametrizace kódu: pokud chcete spouštět stejný kód nad různými vstupními hodnotami, stačí udělat funkci, která dané hodnoty přijme jako parametry (a případně vrátí výsledek výpočtu jako svou návratovou hodnotu). Abstrakce: když rozdělíte logiku programu do sady funkcí, tak si značně usnadníte přemýšlení nad celým programem. Jednotlivé funkce budete moct testovat a přemýšlet nad nimi separátně, nezávisle na zbytku programu. Pomocí používání funkcí také bude mnohem přehlednější čtení programu, protože bude stačit číst, co se provádí (která funkce se volá) a ne jak se to provádí (jaké příkazy jsou v těle funkce). Takovýhle kód pak lze číst téměř jako větu v přirozeném jazyce: int health = get_player_health(player_id);
health = health - calculate_enemy_damage(enemy_id);
set_player_health(player_id, health); Sdílení kódu: pokud budete chtít použít kód, který napsal někdo jiný, tak toho dosáhnete právě používáním funkcí, které vám někdo připraví .

87.body:
Příkaz #include slouží ke vložení obsahu jiného souboru do vašeho zdrojového kódu. Tento příkaz existuje ve dvou variantách: #include <cesta k souboru>
#include "cesta k souboru" Rozdíl mezi nimi je popsán níže . Jakmile preprocesor narazí na tento příkaz, tak se pokusí najít soubor na uvedené cestě, zpracuje jeho obsah (tj. vyhodnotí případné další příkazy jako #include, které v něm mohou být) a poté jeho obsah vloží na místo, kde je #include použit. Jedná se o prosté textové nahrazení (Ctrl+C -> Ctrl+V). Tento příkaz slouží k tomu, abychom mohli používat stejný kód ve více souborech bez toho, abychom jej museli neustále ručně kopírovat. Prozatím budeme vkládat do našeho kódu zejména soubory obsahující různé funkce standardní knihovny C . Později si pak ukážeme, jak vytvářet C programy sestávající se z více zdrojových souborů . Zkuste si například tento zdrojový soubor pojmenovat jako main.c a pomocí příkazu gcc -P -E main.c v terminálu zjistit, jak vypadá poté, co na něj byl aplikován preprocesor: #include <stdio.h>
int main() { printf("Hello world\n"); return 0;
} Asi je zřejmé, že by nebylo praktické kopírovat ručně všechen tento kód pokaždé, když bychom chtěli něco vytisknout na výstup programu.

90.body:
Občas můžeme chtít v programech použít stejnou hodnotu na více místech. V takovém případě se hodí danou hodnotu pojmenovat, aby bylo zřejmé, co reprezentuje. Zároveň by bylo užitečné ji nadefinovat pouze na jednom místě, abychom její hodnotu mohli jednoduše manuálně změnit bez toho, abychom při tom museli upravovat všechna místa, kde danou hodnotu používáme. Pomocí příkazu #define <název> <hodnota> můžeme vytvořit makro ( macro ) s daným názvem a hodnotou. Pokud preprocesor v kódu od řádku s #define do konce zdrojového kódu narazí na název makra, tak tento název nahradí hodnotou makra (opět se jedná o prosté textové nahrazení, tedy Ctrl+C -> Ctrl+V). Zkuste si například, co vypíše tento program: #include <stdio.h> #define CENA 25 int main() { printf("Cena je %d\n", CENA); printf("Dvojnasobek ceny je %d\n", CENA * 2); return 0;
} Představte si, že hodnotu tohoto makra používáme v programu na stovkách míst. Pokud bychom ji potřebovali změnit, tak stačí změnit jeden řádek s #define a preprocesor se poté postará o to, že se hodnota aktualizuje na všech použitých místech. Makra jsou dle konvence obvykle pojmenována "caps-lockem", tedy velkými písmeny (respektive stylem screaming snake case ). Je třeba brát na vědomí, že preprocesor opravdu dělá pouhé textové nahrazení. Například následující kód tak nedává smysl: #define CENA 25
int main() { CENA = 0; return 0;
} protože po spuštění preprocesoru se z něj stane tento (nesmyslný) kód: int main() { 25 = 0; return 0;
}

91.body:
Makra můžou také obsahovat parametry: #define <název_makra>(<param1>, <param2>, ...) <hodnota_makra> Tyto parametry můžete použít pro definici hodnoty. Nicméně je opět třeba dát pozor na to, že preprocesor pracuje pouze s textem, nerozumí jazyku C . Parametry tak jsou předávány čistě jako text, je tak potřeba dávat si pozor na několik věcí: Priorita operátorů - pokud bychom chtěli vytvořit makro pro výpočet druhé mocniny, můžeme ho napsat například takto: #define MOCNINA(a) a * a Pokud však takovéto makro použijeme s nějakým komplexním výrazem, nemusíme dosáhnout kýženého výsledku kvůli priority operátorů: #include <stdio.h> #define MOCNINA(a) a * a int main() { printf("%d
", MOCNINA(1 + 1)); return 0;
} Řádek s printf totiž preprocesor změní na printf("%d
", 1 + 1 * 1 + 1);, což jistě není to, co jsme chtěli. Proto je dobré při použití maker s parametry obalovat jednotlivé parametry závorkami: #define MOCNINA(a) (a) * (a) Pak by zde již došlo k úpravě na printf("%d
", (1 + 1) * (1 + 1));, což vrátí druhou mocninu hodnoty 1 + 1, tedy 4. Vedlejší efekty - pokud mají argumenty předávané do makra nějaké vedlejší efekty , je třeba si dávat pozor na to, že makro může jednoduše takovýto argument rozkopírovat a tím pádem vedlejší efekt provést vícekrát. Například při použití makra MOCNINA výše by zde došlo k dvojnásobené inkrementaci proměnné x: #include <stdio.h> #define MOCNINA(a) a * a int main() { int x = 0; int mocnina = MOCNINA(x++); printf("%d
", x); return 0;
} Do maker tak radši nedávejte argumenty, které způsobují vedlejší efekty.
